<!DOCTYPE html>
<html>
<head>
	<style>

		:root {
			--width: 1920px;
			--height: 1080px;
			--bufferMult: 1.5;

			--ferryLength: 600px;
			--ferryDistance: calc(var(--width) + var(--ferryLength) * var(--bufferMult));
			--junkLength: 350px;
			--junkDistance: calc((var(--width) + var(--junkLength)) * -1 * var(--bufferMult));
		}

		#spokes{
			transform-origin: 1063.581px 845.602px;
			animation: rotateWheel 20s linear infinite;
		}

		#starFerry{
			animation: moveRight 100s linear infinite;
			animation-direction: alternate;

		}

		#junkBoat{
			animation: moveLeft 60s linear infinite;
		}

		.sign *{
			/*filter: brightness(1) !important;*/
			filter: url(#glowSoft) !important;
		}

		.glows, .glows *{
			filter: url(#glowStrong) !important;
		}

		.glowsSoft, .glowsSoft *{
			filter: url(#glowSoft) !important;
		}

		.bankOChinaLights *{
		}

		.teleLights *{
			opacity: 100%;
			stroke: #83F52C;
		}

		.hsbcLadders *{
			stroke: red;
		}

		.hsbcText {
			stroke: turquoise;
			fill: black;
			stroke-width: 0.5px;
		}

		.hsbcBar {
			fill: red;
		}

		.windows *{
			fill: lightyellow;
		}

		.windowOn, .windowOn *{
			filter: url(#glowWindow) !important;
			fill: #ffff4c;
			opacity: 1;
		}
		.windowOnWhite, .windowOnWhite *{
			filter: url(#glowWindow) !important;
			fill: lightYellow;
			opacity: 1;
		}

		.windowOnBlue, .windowOnBlue *{
			filter: url(#glowWindow) !important;
			fill: #e6f3f7;
			opacity: 1;
		}

		.visible, .visible *{
			opacity: 1;
			transition-property: fill;
		}


		.bigGuyHat {
			fill: #83F52C;
		}

		.wheelWhite *{
			stroke: white;
		}

		.wheelBlue *{
			stroke: darkblue;
		}

		.groundLights {
			stroke: yellow;
			stroke-width:2px;
			filter: url(#glowStrongest) !important;
		}

		line, path, polygon, rect, ellipse, polyline, circle{
			/*filter: brightness(0.3);*/
			/*animation: dimBuildings 20s linear infinite;*/
			/*animation-direction: alternate;*/
			filter: url(#brightnessBuildings);
		}

		#water, #background_x5F_buildings *{
			/*animation: dim 20s linear infinite;*/
			filter: url(#brightness);

		}
		
		#skyRect{
			/*animation: sky 20s linear infinite;*/
			filter: url(#sky) !important;
		}

		#starFerry line, #starFerry path, #starFerry polygon, #starFerry rect, #starFerry ellipse, #starFerry polyline, #starFerry circle{
			/*filter: brightness(0.3);*/
			/*animation: dimBuildings 20s linear infinite;*/
			/*animation-direction: alternate;*/
			filter: url(#brightness);
		}

		#junkBoat line, #junkBoat path, #junkBoat polygon, #junkBoat rect, #junkBoat ellipse, #junkBoat polyline, #junkBoat circle{
			/*filter: brightness(0.3);*/
			/*animation: dimBuildings 20s linear infinite;*/
			/*animation-direction: alternate;*/
			filter: url(#brightness);
		}


		@keyframes rotateWheel {
			from {
				transform: rotate(0deg);

			}
			to {
				transform: rotate(360deg);
			}
		}

		@keyframes moveRight {
			from {
				transform: translateX(0px);
			}

			to {
				transform: translateX(var(--ferryDistance));
			}
		}

		@keyframes moveLeft {
			from {
				transform: translateX(0px);
			}

			to {
				transform: translateX(var(--junkDistance));
			}
		}
	</style>
</head>

<script>
	Window = function(groupName,typeStr, density=0.3){
		this.density = density
		document.getElementById(groupName).classList.add('visible')
		this.windows = Array.from(document.getElementById(groupName).querySelectorAll(typeStr))
	}

	let bigGuyWindows = new Window('bigGuyWindows','rect',0.1)
	let bigGuySideWindows = new Window('bigGuySideWindows','polygon',0.1)
	let curvyWindows = new Window('curvyWindows','rect')
	let blueHatWindows = new Window('blueHatWindows','rect',0.4)
	let linesWindows = new Window('linesWindows','rect',0.8)
	let headWindows = new Window('headWindows','rect',0.15)
	//let bigSignWindows = getAllFromEl('bigSignWindows','rect')
	//let bigSignSideWindows = getAllFromEl('bigSignSideWindows','polygon')
	let boxWindows = new Window('boxWindows','rect',0.15)
	let teleWindows = new Window('teleWindows','rect')
	let jardineWindows = new Window('jardineWindows','circle')
	let mandarinWindows = new Window('mandarinWindows','rect')
	let oneIfcWindows = new Window('oneIfcWindows','rect, polygon',0.15)
	let twoIfcWindows = new Window('twoIfcWindows','rect, polygon')
	let windowsList = [
	bigGuyWindows,
	bigGuySideWindows,
	curvyWindows,
	blueHatWindows,
	linesWindows,
	headWindows,
	boxWindows,
	teleWindows,
	jardineWindows,
	mandarinWindows,
	oneIfcWindows,
	twoIfcWindows
	]
	//windowsList.forEach((wl)=>windows = windows.concat(wl))

	let bigSignWindows = {density:0.05, windows:[]}
	let el = document.getElementById('bigSignSideWindows')
	el.classList.add('visible')
	let windowRows = Array.from(el.children)
	windowRows.forEach((wGroup)=>Array.from(wGroup.children).forEach((w)=>bigSignWindows.windows.push(w)))
	//windowRows.forEach((wGroup)=>windowsList.push(Array.from(wGroup.children)))
	el = document.getElementById('bigSignWindows')
	el.classList.add('visible')
	windowRows = Array.from(el.children)
	windowRows.forEach((wGroup)=>Array.from(wGroup.children).forEach((wClust)=>{
		Array.from(wClust.children).forEach((w)=>{
			if (w.getAttribute('height')=="5"){
				bigSignWindows.windows.push(w)
			}
		})
	}))

	windowsList.push(bigSignWindows)
	var windowCurr = []
	var windowAll = []
	windowsList.forEach((wObj) => windowAll.push(...wObj.windows))

	windowsList.forEach((windowsObj)=>{
		windows = windowsObj.windows
		for (let _=0; _<Math.round(windows.length*windowsObj.density); _++){
			let i = Math.round(Math.random()*windows.length)%windows.length
			let className = Math.random()>0.8 ? 'windowOnBlue' : (Math.random()>0.75 ? 'windowOnWhite' : 'windowOn')
			windowCurr.push(windows[i])
			windows[i].classList.add(className)
			//windows.splice(i,1)
		}
	})
	var count = 0
	lastTime = null
	twinkle = (time) => {
		if (lastTime==null){ lastTime = time-500 }
			if (lastTime>time+500){
				return
			}
			lastTime = time
			for (let _=0; _<1+Math.round(Math.random()*2); _++){
				let i = Math.round(Math.random()*windowCurr.length)%windowCurr.length,
				w = windowCurr[i]

				w.classList.remove('windowOn','windowOnWhite','windowOnBlue')
				count +=1
				windowCurr.splice(i,1)
				i = Math.round(Math.random()*windowAll.length)%windowAll.length
				w = windowAll[i]
				while(w.classList.contains('windowOn') || w.classList.contains('windowOnWhite') || w.classList.contains('windowOnBlue')){
					i = Math.round(Math.random()*windowAll.length)%windowAll.length
					w = windowAll[i]
				}
				let className = Math.random()>0.8 ? 'windowOnBlue' : (Math.random()>0.75 ? 'windowOnWhite' : 'windowOn')
				w.classList.add(className)
				windowCurr.push(w)
			}
			window.requestAnimationFrame(twinkle)
		}
		window.requestAnimationFrame(twinkle)
		document.getElementById('oneIfcHat').classList.add('glows')
		document.getElementById('twoIfcHat').classList.add('glows')
		document.getElementById("bigGuyHat").classList.add('bigGuyHat','glows')
		document.getElementById('wheelWhite').classList.add('wheelWhite','glows')
		document.getElementById('wheelBlue').classList.add('wheelBlue','glows')
		document.getElementById('groundLights').classList.add('groundLights')
		document.getElementById('linesSign').classList.add('sign')
		document.getElementById('mandarinSign').classList.add('sign')
		document.getElementById('bigGuySign').classList.add('sign')
		document.getElementById('curvySign').classList.add('sign')
		document.getElementById('blueHatSign').classList.add('sign')
		document.getElementById('teleLights').classList.add('teleLights','glows')
		document.getElementById('teleSign').classList.add('glowsSoft')
		document.getElementById('bigSignLogo').classList.add('sign')
		document.getElementById('hsbcText').classList.add('hsbcText','glowsSoft')
		document.getElementById('hsbcDumplings').classList.add('glowsSoft')
		document.getElementById('hsbcLogo').classList.add('glowsSoft')
		document.getElementById('hsbcBar').classList.add('hsbcBar','glowsSoft')
		document.getElementById('hsbcLadders').classList.add('hsbcLadders', 'glowsSoft')


	</script>
